import styles from './header.module.css';

function Header() {
    return (
        <header className={styles.header}>
            <h1>NETFLIX</h1>
            <input type="text" />
            <button>Search</button>
            <img src="https://picsum.photos/200/300" alt="hi" />
        </header>
    );
}

export default Header;
